module.exports = "<!-- ----------  If a query has been provided as search parameters in the Url,                        ---------- -->\n<!-- ----------  and there are some search criteria which can not be found in our lists of criteria.  ---------- -->\n<!-- ----------  This \"popup\" will list the missing criteria, and suggest that the user log in.       ---------- -->\n<!-- ----------  @TODO Change message if the user is already logged in.                               ---------- -->\n\n<div *ngIf=\"displayText.length > 0\" class=\"card card-nbia-danger alert-box-div alert-box-shadow missing-criteria\">\n\n    <div class=\"panel-heading\">\n        <div class=\"card-heading card-nbia-header-danger missing-criteria-panel-title\">\n            <img class=\" mt-2 ml-3\" src=\"assets/images/icons/exclamation_red_32px.png\">\n            Inaccessible search criteria\n        </div>\n    </div>\n\n    <div style=\"padding-top:20px\" class=\"card-body\">\n\n        <div *ngFor=\"let t of displayText\" class=\"missing-criteria-list-text\">\n            {{t}}\n        </div>\n        <br>\n        <!--\n                <div class=\"message-text\">\n                    There are criteria in your search string that cannot be found.\n                </div>\n        -->\n\n        <div *ngIf=\"suggestLoggingIn\" class=\"message-text\">\n            Try logging in to access restricted collections.\n        </div>\n\n        <button\n            class=\"btn btn-danger missing-criteria-button\"\n            (click)=\"onCloseClick()\"\n            type=\"button\"\n        >\n            Close\n        </button>\n\n       <button\n            class=\"btn btn-success missing-criteria-button\"\n            (click)=\"onLoginClick()\"\n            type=\"button\"\n        >\n            Login\n        </button>\n    </div>\n</div>\n";

