module.exports = "<!-- ----------  Parent container for three Pie charts  ---------- -->\n\n<div class=\"container-fluid summary-main-panel \"\n>\n    <!-- -----  Results count at the top  ----- -->\n    <div class=\"row\">\n        <div class=\"main-panel-heading\"\n        >\n            <span *ngIf=\"searchResultsCount > -1\"\n                    class=\"badge badge-info p-2\">Search results count:\n                <!-- -1 is no search, 0 is no results -->\n                <span>{{searchResultsCount}}</span>\n            </span>\n        </div>\n    </div>\n\n\n    <!-- -----  The Pie charts  ----- -->\n    <div class=\"row chart-row\">\n\n        <!-- Collections -->\n        <div class=\"col-sm-4 chart-col-left\">\n            <nbia-pie-chart-collections>\n            </nbia-pie-chart-collections>\n        </div>\n\n        <!-- Image Modality -->\n        <div class=\"col-sm-4 chart-col-center\">\n            <nbia-pie-chart-image-modality>\n            </nbia-pie-chart-image-modality>\n        </div>\n\n        <!-- Image Anatomical Site -->\n        <div class=\"col-sm-4 chart-col-right\">\n            <nbia-pie-chart-anatomical-site>\n            </nbia-pie-chart-anatomical-site>\n        </div>\n    </div>\n\n\n    <!--\n        Testing other types of charts.\n\n        <div class=\"row chart-row\">\n            <div class=\"col-sm-4 chart-col-left\">\n                <nbia-bar-vertical-chart-collections>\n                </nbia-bar-vertical-chart-collections>\n            </div>\n\n            <div class=\"col-sm-4 chart-col-center\">\n                <nbia-stack-vertical-chart-image-modality>\n                </nbia-stack-vertical-chart-image-modality>\n            </div>\n\n            <div class=\"col-sm-4 chart-col-right\">\n                <nbia-bar-horizontal-chart-anatomical-site>\n                </nbia-bar-horizontal-chart-anatomical-site>\n            </div>\n        </div>\n\n    -->\n\n</div>\n";

