"use strict";
module.exports = "<!-- ----------  Testing and diagnostic things.  This is never shown in a Production build.  ---------- -->\n\n<div class=\"test-main-panel container-fluid\">\n    <div class=\"row test-top-panel-heading\">\n        <!--\n                <span class=\"label nbia-button\" (click)=\"onUpdateApiServerUrl()\">Update</span>\n        -->\n        API_SERVER_URL\n        <input\n            class=\"textInput\"\n            type=\"text\"\n            [(ngModel)]=\"API_SERVER_URL\"\n        >\n        <span class=\"btn nbia-button\" (click)=\"onUpdateApiServerUrl()\">\n            Set\n        </span>\n\n        <label class=\"checkbox-inline\" for=\"debugCheckbox\">\n            <input\n                type=\"checkbox\"\n                id=\"debugCheckbox\"\n                (click)=\"onDebugCheckboxClick($event.target.checked)\"\n            >\n            Debug</label>\n\n        <label class=\"checkbox-inline\">\n            <input\n                type=\"checkbox\"\n                id=\"apiCallsCheckbox\"\n                [(ngModel)]=\"DEBUG_CURL\"\n                (click)=\"onDebugApiCheckboxClick($event.target.checked)\"\n            >\n            API calls</label>\n        <hr>\n        <b>Search criteria sort</b>\n        <br>\n        <span>\n            Count\n                <input\n                    type=\"radio\"\n                    name=\"radiogroup\"\n                    value=\"Count\"\n                    [checked]=\"sortByCount\"\n                    (change)=\"onSortRadio(true)\"\n                >\n        </span>\n\n        <span>\n            Name\n                <input\n                    type=\"radio\"\n                    name=\"radiogroup\"\n                    value=\"Name\"\n                    [checked]=\"sortByName\"\n                    (change)=\"onSortRadio(false)\"\n                >\n        </span>\n    </div>\n\n</div>\n\n<br>\n<div class=\"test-main-panel container-fluid\">\n    <div class=\"row test-top-panel-heading\">\n        <span class=\"btn nbia-button\" (click)=\"onLoadingDisplay()\">Test loading display</span>\n    </div>\n</div>\n<br>\n\n<div class=\"test-main-panel container-fluid\">\n    <div class=\"row test-panel-heading\">\n        <span class=\"btn nbia-button\" (click)=\"onUpdateClick()\">Update</span>\n\n    </div>\n\n    <div class=\"row test-panel-row\">\n        <input class=\"textInput\" type=\"text\" [(ngModel)]=\"token\">\n        <span class=\"btn nbia-button\" (click)=\"onOkayClick()\">Set</span>\n    </div>\n</div>\n<br>\n\n<!--\n\n<div class=\"test-main-panel container-fluid\">\n    <div class=\"row test-panel-heading\">\n        <span class=\"label label-primary test-label\">To Do</span>\n    </div>\n\n    <div class=\"row test-panel-row\">\n        <ul>\n            <li><i><b>Clear Cart</b></i> causes each Subject to look up his Studies, then Series.  Go straight from the Series if we can.</li>\n            <li>Wait/busy screen/message</li>\n            <li>Client side error handling</li>\n            <li>Select all for cart Checkbox is wrong. Test w/query from 2 categories. <b>Fixed needs more testing</b></li>\n            <li>Selecting Manufacturer Model parents and children repeatedly does not always work</li>\n            <li><del>Charts are broken</del></li>\n            <li>New Cart downloader</li>\n            <li>\n                <del>Convert Disk space to mb/gb</del>\n            </li>\n            <li>\n                <del>Connect <i>Manufacturer Model</i> UI</del>\n            </li>\n            <li>\n                <del>Add <i>Manufacturer Model</i> to query and query display (may need tweak on the API side)</del>\n            </li>\n            <li>\n                <del>Add sorting to Cart</del>\n            </li>\n            <li>\n                <del>Clear Query button at top does not work right (on the first click)</del>\n            </li>\n            <li>\n                <del>Display <i>Text</i> search query at top</del>\n            </li>\n            <li>\n                <del>Clear query and search results on Logout</del>\n            </li>\n        </ul>\n    </div>\n</div>\n-->\n\n<div class=\"test-main-panel container-fluid\">\n    <div class=\"row test-panel-heading\">\n        <span class=\"btn label-primary test-label\">Wish List - Future version</span>\n    </div>\n\n    <div class=\"row test-panel-row\">\n        <ul>\n            <li>Progress bars</li>\n            <li>Any/All functionality for Anatomical Site</li>\n        </ul>\n    </div>\n</div>\n\n\n<h2>\n<span *ngFor=\"let colorX of colors0\">\n      <span [ngStyle]=\"{'background-color': colorX}\">&nbsp;&nbsp;{{colorX}}&nbsp;&nbsp;</span>\n</span>\n</h2>\n\n<h2>\n<span *ngFor=\"let colorX of colors1\">\n      <span [ngStyle]=\"{'background-color': colorX}\">&nbsp;&nbsp;{{colorX}}&nbsp;&nbsp;</span>\n</span>\n</h2>\n\n\n<h2>\n<span *ngFor=\"let colorX of colors2\">\n      <span [ngStyle]=\"{'background-color': colorX}\">&nbsp;&nbsp;{{colorX}}&nbsp;&nbsp;</span>\n</span>\n</h2>\n\n<ul>\n    <li *ngFor = \"let modality of properties.OHIF_MODALITIES\">\n        {{modality}}\n    </li>\n</ul>\n<h2>{{currentUser}}</h2>\n<ul>\n    <li *ngFor = \"let role of currentUserRoles\">\n        {{role}}\n    </li>\n</ul>\n";

